  \"This asset contains all Underground Storage Tank (UST) site information. It includes
  details such as property location, acreage, identification and characterization,
  and site assessments (current and historical) and characterization. This information
  is collected and held at the state/territory level. Regulatory authority for the
  collection of this information is found in Subtitle I of the Resource Conservation
  and Recovery Act (RCRA), as amended by the Hazardous Waste Disposal Act of 1984,
  which brought underground storage tanks (USTs) under federal regulation.\",\n\t\"license_title\":
